/*Table structure for table `tbl_car_physical_damages` */

DROP TABLE IF EXISTS `tbl_car_physical_damages`;

CREATE TABLE `tbl_car_physical_damages` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `car_id` int(10) NOT NULL,
  `company_id` int(10) NOT NULL,
  `photo` varchar(50) NOT NULL,
  `description` text NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `deleted_status` int(10) NOT NULL DEFAULT '0',
  `status` int(10) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `car_id` (`car_id`),
  KEY `tbl_car_physical_damages_ibfk_2` (`company_id`),
  CONSTRAINT `tbl_car_physical_damages_ibfk_1` FOREIGN KEY (`car_id`) REFERENCES `tbl_cars` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_car_physical_damages_ibfk_2` FOREIGN KEY (`company_id`) REFERENCES `tbl_companies` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

