/*Table structure for table `tbl_cars` */

DROP TABLE IF EXISTS `tbl_cars`;

CREATE TABLE `tbl_cars` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `company_id` int(10) NOT NULL,
  `make_id` int(10) NOT NULL,
  `model_id` int(10) NOT NULL,
  `body_type_id` int(10) NOT NULL,
  `number_plate` varchar(50) NOT NULL,
  `photo` varchar(50) NOT NULL,
  `service_millage` int(10) NOT NULL,
  `year_id` int(10) NOT NULL,
  `consumption` int(10) NOT NULL,
  `fuel_type` varchar(50) NOT NULL,
  `chasis_number` varchar(50) NOT NULL,
  `engine_id` int(10) NOT NULL,
  `millage` varchar(50) NOT NULL,
  `country` varchar(50) NOT NULL,
  `tyre_id` int(10) NOT NULL,
  `last_service_date` date DEFAULT NULL,
  `last_service_millage` varchar(50) DEFAULT NULL,
  `insurance_exp_date` date DEFAULT NULL,
  `spare_tire` int(10) NOT NULL,
  `fire_extinguisher` int(10) NOT NULL,
  `jerk` int(10) NOT NULL,
  `wheel_spanner` int(10) NOT NULL,
  `physical_damages` text,
  `no_physical_damages` int(10) NOT NULL DEFAULT '0',
  `mechanical_issues` text,
  `no_mechanical_issues` int(10) NOT NULL DEFAULT '0',
  `is_assigned` int(10) NOT NULL DEFAULT '0',
  `status` int(10) NOT NULL DEFAULT '1',
  `car_taken_status` int(10) NOT NULL DEFAULT '0',
  `is_default` int(10) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `make_id` (`make_id`),
  KEY `model_id` (`model_id`),
  KEY `tbl_cars_ibfk_3` (`company_id`),
  KEY `body_type_id` (`body_type_id`),
  KEY `engine_id` (`engine_id`),
  KEY `year_id` (`year_id`),
  KEY `tyre_id` (`tyre_id`),
  CONSTRAINT `tbl_cars_ibfk_3` FOREIGN KEY (`company_id`) REFERENCES `tbl_companies` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_cars_ibfk_4` FOREIGN KEY (`body_type_id`) REFERENCES `tbl_body_type` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_cars_ibfk_5` FOREIGN KEY (`make_id`) REFERENCES `tbl_car_make` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_cars_ibfk_6` FOREIGN KEY (`model_id`) REFERENCES `tbl_car_models` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_cars_ibfk_7` FOREIGN KEY (`engine_id`) REFERENCES `tbl_engines` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_cars_ibfk_8` FOREIGN KEY (`year_id`) REFERENCES `tbl_car_years` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_cars_ibfk_9` FOREIGN KEY (`tyre_id`) REFERENCES `tbl_tyres` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
