/*Table structure for table `tbl_companies` */

DROP TABLE IF EXISTS `tbl_companies`;

CREATE TABLE `tbl_companies` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `industry_id` int(10) NOT NULL,
  `title` varchar(50) NOT NULL,
  `photo` varchar(50) NOT NULL,
  `contact_person` varchar(50) NOT NULL,
  `email` varchar(50) NOT NULL,
  `phone_number` varchar(50) NOT NULL,
  `location` mediumtext NOT NULL,
  `no_employees` int(10) NOT NULL,
  `no_vehicles` int(10) NOT NULL,
  `raw_password` varchar(50) NOT NULL,
  `password` varchar(50) NOT NULL,
  `changed_initial_password` int(10) NOT NULL DEFAULT '0',
  `password_reset_token` varchar(100) DEFAULT NULL,
  `is_default` int(10) NOT NULL DEFAULT '0',
  `status` int(10) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `tbl_companies_ibfk_1` (`industry_id`),
  CONSTRAINT `tbl_companies_ibfk_1` FOREIGN KEY (`industry_id`) REFERENCES `tbl_industries` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

