/*Table structure for table `tbl_requests` */

DROP TABLE IF EXISTS `tbl_requests`;

CREATE TABLE `tbl_requests` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `user_id` int(10) NOT NULL,
  `car_id` int(10) NOT NULL,
  `company_id` int(10) NOT NULL,
  `request_type` varchar(100) NOT NULL,
  `system_id` int(10) NOT NULL,
  `subsystem_id` int(10) NOT NULL,
  `previous_millage` varchar(50) DEFAULT NULL,
  `current_millage` varchar(50) DEFAULT NULL,
  `fuel_quantity` varchar(50) DEFAULT NULL,
  `description` text,
  `no_description` int(10) NOT NULL DEFAULT '0',
  `on_behalf` int(10) NOT NULL DEFAULT '0',
  `request_raised_user_id` int(10) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `email_sent` int(10) NOT NULL DEFAULT '0',
  `deleted_status` int(10) NOT NULL DEFAULT '0',
  `status` int(10) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `system_id` (`system_id`),
  KEY `subsystem_id` (`subsystem_id`),
  KEY `car_id` (`car_id`),
  KEY `user_id` (`user_id`),
  KEY `request_raised_user_id` (`request_raised_user_id`),
  KEY `company_id` (`company_id`),
  CONSTRAINT `tbl_requests_ibfk_3` FOREIGN KEY (`car_id`) REFERENCES `tbl_cars` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_requests_ibfk_4` FOREIGN KEY (`user_id`) REFERENCES `tbl_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_requests_ibfk_5` FOREIGN KEY (`request_raised_user_id`) REFERENCES `tbl_users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_requests_ibfk_6` FOREIGN KEY (`company_id`) REFERENCES `tbl_companies` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_requests_ibfk_7` FOREIGN KEY (`system_id`) REFERENCES `tbl_system` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_requests_ibfk_8` FOREIGN KEY (`subsystem_id`) REFERENCES `tbl_sub_system` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=latin1;

