/*Table structure for table `tbl_sub_system` */

DROP TABLE IF EXISTS `tbl_sub_system`;

CREATE TABLE `tbl_sub_system` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `system_id` int(10) NOT NULL,
  `title` varchar(50) NOT NULL,
  `is_default` int(10) NOT NULL DEFAULT '0',
  `status` int(10) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `system_id` (`system_id`),
  CONSTRAINT `tbl_sub_system_ibfk_1` FOREIGN KEY (`system_id`) REFERENCES `tbl_system` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
