/*Table structure for table `tbl_supplier_systems` */

DROP TABLE IF EXISTS `tbl_supplier_systems`;

CREATE TABLE `tbl_supplier_systems` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `system_id` int(10) NOT NULL,
  `supplier_id` int(10) NOT NULL,
  `status` int(10) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `system_id` (`system_id`),
  KEY `supplier_id` (`supplier_id`),
  CONSTRAINT `tbl_supplier_systems_ibfk_2` FOREIGN KEY (`supplier_id`) REFERENCES `tbl_suppliers` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_supplier_systems_ibfk_3` FOREIGN KEY (`system_id`) REFERENCES `tbl_system` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

