/*Table structure for table `tbl_users` */

DROP TABLE IF EXISTS `tbl_users`;

CREATE TABLE `tbl_users` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `role_id` int(10) NOT NULL,
  `company_id` int(10) NOT NULL,
  `car_id` int(10) NOT NULL,
  `first_name` varchar(50) NOT NULL,
  `last_name` varchar(50) NOT NULL,
  `email` varchar(50) NOT NULL,
  `phone_number` varchar(50) NOT NULL,
  `dl_number` varchar(50) DEFAULT NULL,
  `photo` varchar(50) DEFAULT NULL,
  `dl_photo` varchar(50) DEFAULT NULL,
  `dl_expiry` date DEFAULT NULL,
  `qualified_status` int(10) NOT NULL,
  `raw_password` varchar(100) NOT NULL,
  `password` varchar(100) NOT NULL,
  `changed_initial_password` int(10) NOT NULL DEFAULT '0',
  `password_reset_token` varchar(100) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `is_default` int(10) NOT NULL DEFAULT '0',
  `status` int(10) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `car_id` (`car_id`),
  KEY `tbl_drivers_ibfk_2` (`company_id`),
  KEY `role_id` (`role_id`),
  CONSTRAINT `tbl_users_ibfk_1` FOREIGN KEY (`car_id`) REFERENCES `tbl_cars` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_users_ibfk_2` FOREIGN KEY (`company_id`) REFERENCES `tbl_companies` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tbl_users_ibfk_3` FOREIGN KEY (`role_id`) REFERENCES `tbl_roles` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;

